import React, { useEffect } from 'react'
import AdminRegistration from '../components/admin/AdminRegistration'
import { connect } from 'react-redux'
import { getAllSupportTasks, editSupportTasks, deleteSupportTask } from '../redux/actions/adminActions'
import TasksList from '../components/admin/TasksList'

function Admin({ tasks, getAllSupportTasks, editSupportTasks, deleteSupportTask }) {

  useEffect(() => {
    getAllSupportTasks();
  }, []);

  return (
    <div>
      <AdminRegistration />
      <TasksList tasks={tasks}
        editSupportTasks={editSupportTasks}
        deleteSupportTask={deleteSupportTask} />
    </div>
  )
}

const mapStateToProps = state => {
  return {
    tasks: state.admin.tasks
  }
}

const mapDispatchToProps = {
  getAllSupportTasks, editSupportTasks, deleteSupportTask
}

export default connect(mapStateToProps, mapDispatchToProps)(Admin);
